	public static void main(String[] args) {
		Map<String,Object> params = new HashMap<String, Object>();
		params.put("a", 3);
		params.put("b", 5);
		params.put("c", 2);
		Double value = calculationByFormula(params, "c+(a+b)");
		System.out.println(value);
		
		
		
		
		String str = "shiji/zhuanchefuwu_shourubenyueshiji";
		 str = replaceFirst(str, "shiji", "f");
		 str = replaceFirst(str, "zhuanchefuwu_shourubenyueshiji", "s");
		System.out.println(str);
		
	}
	
	/**
	 * 根据公式进行计算
	 * @param params 公式所需变量
	 * @param formula 公式
	 * @return
	 */
	public static Double calculationByFormula(Map<String,Object> params,String formula){
		Binding binding = new Binding();
        GroovyShell shell = new GroovyShell(binding);
        String[] varArray = splitFormula(formula);
        for(String var:varArray) {
        	Object value = params.get(var);
        	if(value == null) {
        		value = 0;
        	}
        	binding.setVariable(var,value);
        }
//        for(Iterator<String> iter = params.keySet().iterator();iter.hasNext();) {
//        	String key = iter.next();
//        	binding.setVariable(key,params.get(key));
//        }
        Object obj =shell.evaluate("return "+formula);
        return Double.valueOf(obj.toString());
	}
	
	public static String replaceFirst(String value,String oldStr,String newStr){
		StringBuffer sb = new StringBuffer(value);
		if(StringUtils.isValid(oldStr)) {
			int start = sb.indexOf(oldStr);
			int end = start+oldStr.length();
			sb.replace(start, end, newStr);
		}
		value = sb.toString();
		return sb.toString();
	}
	
	public static String reallyFormula(JSONArray array,String formula) throws FormulaAnalysisException {
		return replaceFormula(array, formula);
	}
	
	/**
	 * 根据Key获取替换后的公式
	 * @param array 该表格所有对象
	 * @param key
	 * @return
	 * @throws FormulaAnalysisException 
	 */
	public static String getReallyFormulaByKey(JSONArray array,String key) throws FormulaAnalysisException{
		for(int i=0;i<array.size();i++){
			JSONObject json = array.getJSONObject(i);
			String jsonKey = json.getString(FIELD_KEY);
			String formula = json.getString(FORMULA_KEY);
			if(jsonKey.equals(key)) {
				return replaceFormula(array, formula);
			}
		}
		return null;
	}
	
	/**
	 * 分隔公式,将所有加减乘除项分隔
	 * 如:a+b*c,则分隔成a,b,c
	 * @param formula 公式
	 * @return
	 */
	public static String[] splitFormula(String formula){
		List<String> list = new ArrayList<String>(); 
		String[] attrs = formula.split(OPERATOR_REGEX);
		for(String attr:attrs) {
			if(attr!=null && !attr.equals("")) {
				list.add(attr);
			}
		}
		return list.toArray(new String[]{});
	}
	
	/**
	 * 根据公式替换成真实公式
	 * @param array 该表格所有对象
	 * @param formula 该对象公式
	 * @return
	 */
	public static String replaceFormula(JSONArray array,String formula) throws FormulaAnalysisException {
		if(formula!=null && !formula.equals("")) {
			String[] attrs = splitFormula(formula);
			for(String attr:attrs) {
				if(attr.equalsIgnoreCase("SUM")) {
					continue;
				}
				String subFormula = getFormulaByKey(array,attr);
				if(subFormula==null) {
//					throw new FormulaAnalysisException(attr+" not is found");
					continue;
				}
				if(!subFormula.equals("")) {
					formula = formula.replaceAll(attr, "("+subFormula+")");
					return replaceFormula(array,formula);
				}
			}
		}
		return formula;
	}
	
	/**
	 * 根据KEY获取该对象简单公式
	 * @param array 该表格所有对象
	 * @param key 需要获取公式的对象的KEY
	 * @return
	 */
	public static String getFormulaByKey(JSONArray array,String key){
		for(int i=0;i<array.size();i++){
			JSONObject json = array.getJSONObject(i);
			String jsonKey = json.getString(FIELD_KEY);
			if(jsonKey.equals(key)) {
				return json.getString(FORMULA_KEY);
			}
		}
		return null;
	}
